var world_proxy = Java.type("org.jawbts.noglerr.tweak.var.javascript.proxy.World");
var entity_proxy = Java.type("org.jawbts.noglerr.tweak.var.javascript.proxy.Entity");

function test(entity, utils) {
	var world = entity.getWorld();
	world = new world_proxy(world);
	var players = world.getPlayers();
	var p_players = [];
	var flag = 0, mes = "";
	for (var i in players) {
		p_players[i] = new entity_proxy(players[i]);
		pic(p_players[i], utils);
		if (i != 0) {
			if (p_players[0].isInRange(players[i], 20)) {
				flag += 1;
				mes += " " + p_players[i].getName().toString();
			}
		}
	}
	// utils.sendMesToPublic("Nearby players: " + flag + mes);
}


