function logo(entity, utils) {
	var pos = get_entity_pos(entity);

	var points = JSON.parse(data);
	for (var i in points) {
		var p = points[i];
		utils.sendMesToPublic("/particle minecraft:end_rod " + (pos.x + p.x * 5.68 * 4 - 2) + " " + (pos.y + 3.9 * 4 - p.y * 3.9 * 4) + " " + (pos.z - 4)) + "0 0 0 0 1 force";
	}
}

function pic(entity, utils) {
	var pos = get_entity_pos(entity);

	generate_flame_block(utils, pos.x, pos.y, pos.z);
}

function get_entity_pos(entity) {
	var x = Math.round(entity.getX()) - 0.5;
	var y = Math.round(entity.getY()) + 0.5;
	var z = Math.round(entity.getZ()) - 0.5;

	return {x: x, y: y, z: z};
}

function generate_flame_block(utils, x, y, z) {
	for (var ix = -0.5; ix <= 0.5; ix += 0.3) {
		for (var iy = -0.5; iy <= 0.5; iy += 0.3) {
			for (var iz = -0.5; iz <= 0.5; iz += 0.3) {
				utils.sendMesToPublic("/particle minecraft:flame " + (x + ix) + " " + (y + iy) + " " + (z + iz));
			}
		}
	}
}